import React from "react";
import { Link } from "react-router-dom";
import "../App.css";

const ContactList = props => {
  const contact = props.contact;

  return (
    <div className="contact-container">
      <div className="desc">


        <h3>{contact.email}</h3>
        <p>{contact.message}</p>
      </div>
    </div>
  );
};

export default ContactList;
